import Navbar from '../components/Navbar'

const Index = () => (
    <div>
    <head>
        <link href="https://fonts.googleapis.com/css?family=Roboto" rel="stylesheet"></link>
    </head>
    <Navbar />
    <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }
        div{
            margin:0;
            padding:10px 50px;
        }
      `}</style>
    </div>
  )

  export default Index
